import { style } from "typestyle";

import biuryBoxImage from '../../../../assets/images/Home/Biury_Fotos-02.png'

const BiuryBoxStyle = style({
    background: 'red',
    display: 'flex',
    height: '100vh',
    width: '100%',
    $nest: {
        '& .biuryBox_image': {
            width: '50%',
            height: '100%'
        }
    }
})

export default BiuryBoxStyle
